import React from 'react'
import TopBar from '../../TopBar';

/**
 * The ChooseVariablePage is used to choose 
 * a variable
 */
class ChooseVariablePage extends React.Component {
    render() { 
        return (  
            <div>
                <TopBar title="Choose Variable"></TopBar>
            </div>
        );
    }
}

export default ChooseVariablePage;
